import classes from './TourPackage.css';
import Link from '../../../hoc/UI/LinkTag/Link';
class tourPackage extends Component {
	shouldComponentUpdate(nextProps, nextState) {
		if (nextProps !== this.props) return true;

		return false;
	}
	render() {
		return (
			// we send get request with pkg id to show more about package
			<div className={classes.TourPackage} onClick={props.clicked}>
				<p> {props.tourPkge.title}</p>
				<Link link='/'>More about..</Link>
			</div>
		);
	}
}

export default tourPackage;
